import React from "react";
import { Link } from "react-router-dom";

const tabsEvento = props => {
  return (
    <div className="container">
      <div className="card-panel z-depth-3">
        <ul className="tabs">
          <div className="row">
            <li className="tab col s6">
              <Link
                style={{ color: "blue" }}
                to="#"
                onClick={props.handleClickEventosAtivos}
              >
                Eventos ativos
              </Link>
            </li>
            <li className="tab col s6">
              <Link
                style={{ color: "blue" }}
                to="#"
                onClick={props.handleClickEventosAnteriores}
              >
                Hist√≥rico de eventos
              </Link>
            </li>
          </div>
        </ul>
      </div>
    </div>
  );
};

export default tabsEvento;
